import React from "react";
import { NavBar } from "./NavBar";
import { TopBar } from "./TopBar";

export function Menu({children}){
    return (
        <Fragment>
            <NavBar/>
            <section className="full-width pageContent">
                <TopBar/>
                {children}
            </section>
        </Fragment>
    )
}
